var total = $('.reward .bingo').length;
var nowActive = 0;
var runTime = 0;  // 從0開始跑，直到跟stopPlay一樣
var stopPlay = 0; // 會在跑多少格後停下來
var sec = 50;
var lottery = 0; // 代幣數量
var betCoin = 0; // 下注的數量，點擊次數等於下幾枚代幣
var betCount = new Array(14); // 欄位陣列，還沒投注之前代幣起始值預設是0
var thisBet = new Array(14);  
var money = $("#rich:first").text(); // 目前所剩的彩金

initial(); // 遊戲開始，進行初始化，數值歸零

//下注
$('.bingo').click(function(){
    $('.start').css('display','flex');
    var index = $(".gameBlock .bingo").index(this);
    console.log('這是第'+(index+1)+'個格子');
    money = money - 100;
    if(money < 0){
        alert('籌碼已經用完，無法下注');
        money = money + 100; // 系統再給你一百塊
        document.getElementById('rich').innerHTML = money;
    }
    // 先將陣列內元素所在的位置轉成數字，因為陣列是從0開始計算，所以要+1
    // 還沒下注，所以格子內的金額會是0
    // 每點擊一次，，會將該格子被點擊的次數記錄在對應的陣列 betCount[index] 中
    // 然後再將陣列中的值給betCoin，再來計算該格子有投入多少籌碼( totalBet )
    else{
        betCount[index] = parseInt(betCount[index])+1;
        betCoin = betCount[index];
        // console.log('index='+(index+1));
        // console.log(betCoin);
        $(this).find('.content').text(betCoin*100);
        document.getElementById('rich').innerHTML = money;
        var totalBet = parseInt($(this).find('.content').text(), 10);
        thisBet[index] = totalBet;
    }
});

//開始遊戲
$('.start').click(function(){
    $(this).css("display",'none');
    $('.going').css("display",'flex');
    $('.money').fadeOut(200);
    stopPlay = Math.floor(Math.random()*20+20);
	play();
});

// 關閉畫面
$('.closeDiv').click(function(){
	$('.popWindow').fadeOut(200);
    $('.popWindow-mdfk').fadeOut(200);
    $('#rich').html(money);
    $('.money').fadeIn(200);
	initial();
    while(money == 0){
        alert('立爹爹斗內你500元');
        money = money + 500;
        document.getElementById('rich').innerHTML = money;
    }
});

function play(){
	runTime++;
	if(runTime > stopPlay){
        nowActive = nowActive -1;
        document.getElementById('rich').innerHTML = money;
        musicEnding(); // 結束音效
        // 骰到第一個格子(橘子)，獲得1.1倍
        if(nowActive==0){
            lottery = thisBet[0];
            lottery = Math.floor(lottery*1.1);
        }
        // 骰到第二個格子(黑蘋果)，獲得1.6倍
        if(nowActive==1){
            lottery = thisBet[1];
            lottery = Math.floor(lottery*1.6);
        }
        // 骰到第三個格子(檸檬)，獲得1.2倍
        if(nowActive==2){
            lottery = thisBet[2];
            lottery = Math.floor(lottery*1.2);
        }
        // 骰到第四個格子(西瓜)，獲得1.5倍
        if(nowActive==3){
            lottery = thisBet[3];
            lottery = Math.floor(lottery*1.5);
        }
        // 骰到第五個格子(摩艾)，獲得1.1倍
        if(nowActive==4){
            lottery = thisBet[4];
            lottery = Math.floor(lottery*1.1);
        }
        // 骰到第六個格子(發大財)，獲得500倍
        if(nowActive==5){
            lottery = thisBet[5];
            lottery = Math.floor(lottery*500);
        }
        // 骰到第七個格子(紅寶石)，獲得5倍
        if(nowActive==6){
            lottery = thisBet[6];
            lottery = Math.floor(lottery*5);
        }
        // 骰到第八個格子(櫻桃)，獲得1.5倍
        if(nowActive==7){
            lottery = thisBet[7];
            lottery = Math.floor(lottery*1.5);
        }
        // 骰到第九個格子(黑蘋果)，獲得1.6倍
        if(nowActive==8){
            lottery = thisBet[8];
            lottery = Math.floor(lottery*1.6);
        }
        // 骰到第十個格子(檸檬)，獲得1.2倍
        if(nowActive==9){
            lottery = thisBet[9];
            lottery = Math.floor(lottery*1.2);
        }
        // 骰到第十一個格子(西瓜)，獲得1.5倍
        if(nowActive==10){
            lottery = thisBet[10];
            lottery = Math.floor(lottery*1.5);
           
        }
        // 骰到第十二個格子(摩艾)，獲得1.1倍
        if(nowActive==11){
            lottery = thisBet[11];
            lottery = Math.floor(lottery*1.1);
        }
        // 骰到第十三個格子(888)
        if(nowActive==12){
            lottery = thisBet[12];
            lottery = Math.floor(lottery+888);
        }
        // 骰到第十四個格子(紅寶石)，獲得5倍
        if(nowActive==13){
            lottery = thisBet[13];
            lottery = Math.floor(lottery*5);
        }
        // 如果沒有中獎，則顯示MDFK
        if(lottery ==0){
            $('.popWindow-mdfk').fadeIn(300);
            money = money+lottery;
            $('.rewardPost').html(lottery+'元');
        }
        // 如果中獎的話，則顯示中獎資訊
        else{
            $('.popWindow').fadeIn(300);
            Math.floor(lottery);
            money = money+lottery;
            $('.rewardPost').html(lottery+'元');
        }
	}
	else if(runTime + 10 > stopPlay){
        $('.item'+(nowActive)).addClass('active').siblings('.bingo').removeClass('active');
		setTimeout(play, sec=sec*1.4);
        nowActive++;
         while(nowActive == total){
            nowActive = 0;
            if(nowActive < 0){
                nowActive = 0;
            }
        } 
        console.log('runTime='+runTime);
        console.log('目前正跑到第'+ nowActive +'格');
        // 小瑪莉音效
        music();
	}
	else{  
        $('.item'+(nowActive)).addClass('active').siblings('.bingo').removeClass('active');
		setTimeout(play, sec);
        nowActive++;
        while(nowActive == total){
            nowActive = 0;
            if(nowActive < 0){
                nowActive = 0;
            }
        }
        console.log('目前正跑到第'+ nowActive +'格');
        // 小瑪莉音效
        music();
	} 
}
// 初始化
function initial(){
    runTime = 0;
	sec = 50;
    $('.start').css('display','none');
    $('.going').css("display",'none');
    for(var reset=0;reset<14;reset++){
        betCount[reset] = 0;
        thisBet[reset] = 0;
        $('.item'+reset).find('.content').text(""); 
    }
}

// 音效部分music
function musicEnding(){
	var soundRewrad = new Audio("data:audio/mp3;base64,");
	soundRewrad.play();
}
function music(){
	var soundPlay = new Audio("data:audio/mp3;base64,");
	soundPlay.play();
}
